import ExpenseItem from './ExpenseItem';
const Expenses = (props) => {
    console.log(props)
    return (
        
        <div className='expenses'>
            <ExpenseItem title={props.arr[0].title} amount={props.expenses.expenses[0].title.amount} date={props.expenses.expenses[0].date} />
            <ExpenseItem title={props.arr[0].title} amount={props.expenses.expenses[1].title.amount} date={props.expenses.expenses[1].date} />
            <ExpenseItem title={props.arr[0].title} amount={props.expenses.expenses[2].title.amount} date={props.expenses.expenses[2].date} />
        </div>
    )
}

export default Expenses
